import React from 'react';
// import Github from './icons/Github';
// import Twitter from './icons/Twitter';
// import LinkedIn from './icons/LinkedIn';
// import DevTo from './icons/DevTo';

const data = {
  "social": [
    {
      "name": "github",
      "link": "https://github.com/egiurleo",
    },
    {
      "name": "twitter",
      "link": "https://twitter.com/EmilyGiurleo",
    },
    {
      "name": "dev.to",
      "link": "https://dev.to/egiurleo",
    },
    {
      "name": "linkedin",
      "link": "https://linkedin.com/in/egiurleo",
    },
  ],
  "about": "I'm a software engineer at MongoDB working on the <a href=\"https://github.com/mongodb/mongo-ruby-driver\">Ruby driver</a> and <a href=\"https://github.com/mongodb/mongoid\">Mongoid ODM</a>. I have previously worked at <a href=\"https://codecademy.com\">Codecademy</a>. I care a lot about accessible education, civic engagement, and cats.",
  "projects": [
    {
      "title": "FreeFrom Compensation Compass",
      "link": "https://compas.freefrom.org",
      "year": 2019,
      "description": "<a href=\"https://freefrom.org\">FreeFrom</a> is an organization that helps survivors of gender-based violence achieve financial security. As a volunteer with Ragtag, I built a Rails API backend for their new compensation tool, which helps survivors of gender-based violence figure out forms of financial compensation that are available to them.",
    }
  ]
}

export default data;
